function WSComm(){this.send=function(dataToWrite){var xml="<?xml  version=\"1.0\"?>";xml+="<document>";xml+=dataToWrite;xml+="</document>";var userAgent=navigator.userAgent.toLowerCase();if(userAgent.search("android")>-1){window.AndroidInterface.sendData(xml)}else if((userAgent.search("iphone")>-1)||(userAgent.search("ipod")>-1)||(userAgent.search("ipad")>-1)){var message={data:xml};window.webkit.messageHandlers.sendData.postMessage(message)}}};
